import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { Navbar, Nav, Container, Row, Col } from 'react-bootstrap';
import { FaShieldAlt, FaBuilding, FaUserShield, FaUsers, FaListAlt } from 'react-icons/fa';
import TestApi from './components/TestApi';
import UnidadeList from './components/Unidade/UnidadeList';
import UnidadeForm from './components/Unidade/UnidadeForm';
import EquipeList from './components/Equipe/EquipeList';
import EquipeForm from './components/Equipe/EquipeForm';
import ArmaList from './components/Arma/ArmaList';
import ArmaForm from './components/Arma/ArmaForm';
import GuardaList from './components/Guarda/GuardaList';
import GuardaForm from './components/Guarda/GuardaForm';
import MovimentacaoList from './components/Movimentacao/MovimentacaoList';
import MovimentacaoForm from './components/Movimentacao/MovimentacaoForm';
import background from './assets/palacio.jpeg';
import './App.css';

function App() {
  return (
    <Router>
      <div className="app-container d-flex flex-column">
        {/* Navbar topo */}
        <Navbar bg="dark" variant="dark" expand="lg" className="app-header">
          <Container fluid>
            <Navbar.Brand as={Link} to="/">
              <FaShieldAlt style={{ marginRight: '8px' }} />
              Sistema de Controle de Armas
            </Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="ms-auto">
                {/* Coloque aqui links de usuário, logout, etc. */}
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>

        {/* Container de fundo com overlay */}
        <div
          className="app-body flex-grow-1"
          style={{
            background: `url(${background}) no-repeat center center fixed`,
            backgroundSize: 'cover',
            position: 'relative',
          }}
        >
          <div className="overlay"></div>
          <Container fluid className="h-100">
            <Row className="h-100">
              {/* Sidebar */}
              <Col xs={12} md={2} className="sidebar bg-light">
                <Nav className="flex-column p-3">
                  <Nav.Link as={Link} to="/test"><FaShieldAlt /> Teste API</Nav.Link>
                  <Nav.Link as={Link} to="/unidades"><FaBuilding /> Unidades</Nav.Link>
                  <Nav.Link as={Link} to="/nova-unidade"><FaBuilding /> Nova Unidade</Nav.Link>
                  <Nav.Link as={Link} to="/equipes"><FaUsers /> Equipes</Nav.Link>
                  <Nav.Link as={Link} to="/nova-equipe"><FaUsers /> Nova Equipe</Nav.Link>
                  <Nav.Link as={Link} to="/armas"><FaShieldAlt /> Armas</Nav.Link>
                  <Nav.Link as={Link} to="/nova-arma"><FaShieldAlt /> Nova Arma</Nav.Link>
                  <Nav.Link as={Link} to="/guardas"><FaUserShield /> Guardas</Nav.Link>
                  <Nav.Link as={Link} to="/novo-guarda"><FaUserShield /> Novo Guarda</Nav.Link>
                  <Nav.Link as={Link} to="/movimentacoes"><FaListAlt /> Movimentações</Nav.Link>
                  <Nav.Link as={Link} to="/nova-movimentacao"><FaListAlt /> Nova Movimentação</Nav.Link>
                </Nav>
              </Col>

              {/* Conteúdo */}
              <Col xs={12} md={10} className="content-area p-4">
                <Routes>
                  <Route path="/test" element={<TestApi />} />
                  <Route path="/unidades" element={<UnidadeList />} />
                  <Route path="/nova-unidade" element={<UnidadeForm />} />
                  <Route path="/equipes" element={<EquipeList />} />
                  <Route path="/nova-equipe" element={<EquipeForm />} />
                  <Route path="/armas" element={<ArmaList />} />
                  <Route path="/nova-arma" element={<ArmaForm />} />
                  <Route path="/guardas" element={<GuardaList />} />
                  <Route path="/novo-guarda" element={<GuardaForm />} />
                  <Route path="/movimentacoes" element={<MovimentacaoList />} />
                  <Route path="/nova-movimentacao" element={<MovimentacaoForm />} />
                </Routes>
              </Col>
            </Row>
          </Container>
        </div>

        {/* Footer */}
        <footer className="app-footer bg-dark text-white text-center py-2">
          <small>&copy; 2025 Guarda Civil Municipal de Mossoró/RN</small>
        </footer>
      </div>
    </Router>
  );
}

export default App;
